export default class Block {
    /**
     *
     * @param type the type of block on display enmu['empty','cover','mine','flag','question','number']
     * @param number the number of block(if empty, set 0; if mine, set -1)
     * @param x row number
     * @param y column number
     */
    constructor(type, number, y, x) {
        this.type = type;
        this.number = number;
        this.x = x * Block.size;
        this.y = y * Block.size;
    }

    draw(isActive) {
        isActive = isActive || false;

        switch (this.type) {
            case 'empty':
                this._drawEmpty();
                break;
            case 'cover':
                if (isActive) {
                    this._drawActive();
                } else {
                    this._drawCover();
                }
                break;
            case 'mine':
                this._drawMine();
                break;
            case 'flag':
                this._drawFlag();
                break;
            case 'question':
                this._drawQuestion();
                break;
            case 'number':
                this._drawNumber();
                break;
            default:
                console.error('block draw error');
        }
    }

    _drawEmpty() {
        Block.ctx.fillStyle = '#c0c0c0';
        Block.ctx.fillRect(this.x, this.y, Block.size, Block.size);
    }

    _drawCover() {
        Block.ctx.drawImage(Block.pics.cover, this.x, this.y, Block.size, Block.size);
    }

    _drawMine() {
        this._drawEmpty();
        Block.ctx.drawImage(Block.pics.mine, this.x, this.y, Block.size, Block.size);
    }

    _drawNumber() {
        this._drawEmpty();
        Block.ctx.font = "30px Arial";
        Block.ctx.fillText("Hello World", 10, 50);
    }

    _drawFlag() {
        this._drawCover();
        Block.ctx.drawImage(Block.pics.flag, this.x, this.y, Block.size, Block.size);
    }

    _drawQuestion() {
        this._drawCover();
        Block.ctx.font = "30px Arial";
        Block.ctx.fillText("Hello World", 10, 50);
    }

    _drawActive() {
        Block.ctx.fillStyle = '#c0c0c0';
        Block.ctx.fillRect(this.x, this.y, Block.size, Block.size);
    }

}

// static value
const pics = {};
pics.cover = document.createElement('img');
pics.cover.setAttribute('src', 'data:image/png;base64,');
pics.mine = document.createElement('img');
pics.mine.setAttribute('src', 'data:image/png;base64,');
pics.flag = document.createElement('img');
pics.flag.setAttribute('src', 'data:image/png;base64,');

Block.ctx = null;
Block.size = 0;
Block.pics = pics;
